INSERT INTO `navigation_msg` VALUES (527, '庐山东林寺', '购物旅行', 'http://donglin.org', NULL, '【江西庐山东林寺www.donglin.org】建成于东晋太元十一年（386年），为中国佛教净土宗发祥地，南方佛教中心，隋朝以后为全国佛教八大道场之一。历史上，与东林寺结缘的名流高士不乏其人，如佛陀跋陀罗尊者、智者大师、鉴真大师、李世民、刘遗民、谢灵运、陶渊明、孟浩然、韩愈、白居易、柳公权、王安石、苏东坡、李白、陆游、杜甫、杜牧、杜荀鹤、刘长卿、王昌龄、李邕、王阳明、黄庭坚、周敦颐、岳飞、范成大、朱熹、康有为等等。寺内文物甚多，从东晋远公与西域经师译经驻锡的译经台，到清末康有为题刻的《柳公权残碑记》，时间', '2021-08-05');
