INSERT INTO `navigation_msg` VALUES (2718, '人民网台湾频道', '实时关注', 'http://tw.people.com.cn', NULL, '人民网台湾频道于2001年11月28日正式开通。频道以“聚焦海峡热点、增进两岸交流、传递血脉亲情”为宗旨，立足于为两岸网民提供及时丰富的新闻资讯服务，在业界享有较高的知名度。频道设有涉台新闻、两岸交流、台湾要闻、台海观察、视频新闻、台海军情、台湾文娱等20余个新闻栏目。资料类栏目分为部委涉台信息、对台政策、对台机构、涉台法规、走进台湾、台湾人物等。目前，频道已成为集文字、图片、视频、论坛等于一身的两岸新闻综合发布平台，同时也是互联网上一个整合台湾新闻资讯的重要信息源。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (2719, '中国青年网', '实时关注', 'http://youth.cn', 'http://www.youth.cn/favicon.ico', '中国青年网，1999年5月4日正式开通，共青团中央主办的中央重点新闻网站，是国内最大的青年主流网站。中国青年网竭诚服务青年的文化、心理、情感和创业需求，是共青团运用网络文化元素吸引青年的新载体和引导青年的新途径，为团组织通过新媒体融入青年提供有力支撑。 中国青年网拥有400余个子网站，2000多个栏目，用文字、图片、动漫、音视频、论坛、博客、微博、手机、网上直播等多种手段，依托共青团中央丰富的资源，每天向全球网民发布丰富多彩的信息，内容包括政治、经济、社会、文化、娱乐、时尚、教育、心理等各个领域。', '2021-08-07');
