INSERT INTO `navigation_msg` VALUES (2962, '浙江在线', '实时关注', 'http://www.zjol.com.cn', NULL, '浙江在线是国务院新闻办确定的地方重点新闻网站，浙江省省级重点新闻网站和综合性门户网站。网站以“权威媒体、大众网站”为基本定位，内容影响力和经营实力已跃居全国地方网媒前列。2011年9月29日，浙江在线新闻网站纳入“浙报传媒”整体上市，成为国务院新闻办首批十家转企改制新闻网站中第一家成功登陆a股的网络媒体。', '2021-08-07');
