INSERT INTO `navigation_msg` VALUES (2969, '石家庄新闻网', '实时关注', 'http://sjzdaily.com.cn', NULL, '石家庄新闻网，省会中心城市新闻门户，石家庄对外宣传的主流媒体，石家庄市唯一一家拥有国新办新闻发布资质的国家重点地方新闻网站，石家庄日报、燕赵晚报、精品导报、燕赵老年报四报电子版的发布平台。新闻更新量最大、点击量最高的地方新闻网站。30多个独立频道、二百多个新闻栏目，上百个专题数据库。可在40多个省会中心城市的国家重点新闻网站链接本网。', '2021-08-07');
