INSERT INTO `navigation_msg` VALUES (3005, '鲁网', '实时关注', 'http://www.sdnews.com.cn', NULL, '鲁网是经国务院新闻办公室批准设立的全国重点新闻网站，由山东省委网信办主管，山东省新闻工作者协会主办，是山东省委省政府指定新闻发布权威平台、山东省政府新闻发布会图文视频多媒体同步直播指定媒体，已成为了解山东社会经济发展成就的可靠窗口。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3006, '人民网观点频道', '实时关注', 'http://opinion.people.com.cn', NULL, '观点频道是人民网2000年4月开设的全国网站第一个言论频道，设有人民网评、网友说话、观点1+1、专栏评论、快评、漫画等原创评论栏目，是集纳人民网原创评论、人民日报报系评论、各地媒体评论、网站评论等的综合性互联网评论频道。人民网评被赞誉为“网上第一评”，曾多次获中国新闻奖评论一等奖、中国人大新闻奖一等奖。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3007, '星辰在线', '实时关注', 'http://changsha.cn', NULL, '星辰在线(长沙新闻网)是长沙市委市政府官方新闻门户，市委直属的新媒体集团，是湖南省上线最早、长沙市唯一的国家一类资质重点新闻网站。星辰在线由长沙市委宣传部主管主办，是长沙市“一报、一台、一网”媒体格局的重要组成。星辰在线新媒体集团以新闻立网，突出新闻、网络、本土三大特色，开设有长沙新闻、问政长沙（民声）、星辰影像、星辰视听、自在星辰、星辰文旅、星辰教育等重点频道，承办了长沙宣传网、长沙廉政网、和网、长沙文明网等多家政府官方网站，推出了官方新闻客户端“星辰头条”APP。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3008, '荆门新闻网', '实时关注', 'http://jmnews.cn', 'http://www.jmnews.cn/favicon.ico', '荆门新闻网是由中共荆门市委宣传部、荆门市人民政府新闻办公室主管，荆门日报社主办的综合新闻信息服务门户网站，是荆门地区最具影响力的网络媒体。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3009, '荆楚网', '实时关注', 'http://cnhubei.com', 'http://www.cnhubei.com/favicon.ico', '荆楚网由湖北日报传媒集团主办，湖北荆楚网络科技股份有限公司运营，是湖北最大的网络平台。业务涉及新闻资讯、财经房产、时尚娱乐、旅游信息、教育培训、短信服务、福利彩票、社区论坛等，并积极开拓电子商务、动画动漫、二维码产业。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3010, '健康报网', '实时关注', 'http://jkb.com.cn', 'http://jkb.com.cn/favicon.ico', '健康报网，专业的健康资讯门户网站，健康报社官方网站。《健康报》是中华人民共和国卫生部主管的最具影响的全国性卫生行业报。提供最专业、最完善的医疗卫生政策动向、医学、健康知识等健康信息服务，包括行业快讯、医改，农村卫生，社区卫生，科技，管理，医学人文，中医中药，医生园地，寻医问药，健康生活，深度，时评，海外，舆情等频道。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3011, '南海网', '实时关注', 'http://hinews.cn', NULL, '提供最权威、最快捷、最全面海南新闻和海南资讯，成为国内各大网站转载海南新闻主要来源。是海南省唯一重点新闻网站和海南新闻中心及海南在线媒体领军网站，也是海南省最具影响力综合门户网站，由海南日报报业集团主办。', '2021-08-07');
