INSERT INTO `navigation_msg` VALUES (3014, '九尾网', '实时关注', 'http://hqck.net', NULL, '【九尾网】提供当日的《参考消息》和《环球时报》的电子版在线阅读，并筛选出当日：参考消息、环球时报、新浪、观察者网等主流媒体的精华内容供读者阅读，更多内容请访问：参考消息网、环球网等相关主流媒体官网。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3015, '北晚新视觉网', '实时关注', 'http://takefoto.cn', '//www.takefoto.cn/favicon.ico', '北晚新视觉网是北京晚报官方网站，北晚新视觉网是北京晚报主办的网上新媒体，北晚新视觉网是北京晚报的在线互动平台。网站立足北京，每日提供丰富视觉资讯；同时提供新闻、历史图片销售服务。电话：861085201651', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3016, '中国建设报', '实时关注', 'http://chinajsb.cn', 'http://www.chinajsb.cn//Public/zhuj2018/img/bitbug_favicon.ico', '中国建设新闻网是由住房和城乡建设部主管，中国建设报社主办的互联网站。坚持“大资源平台，大数据高地”的目标，为住房城乡建设部提供信息参考与决策支持、为地方和住建系统提供信息服务与工作支撑、为企业跨越式发展提供运营指南与决策咨询、为老百姓安居乐业提供行业资讯与文化娱乐。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3017, '香港文汇网', '实时关注', 'http://wenweipo.com', NULL, '香港文匯網是面向香港社會各界的綜合性主流網站，以愛國愛港為宗旨，堅持「文以載道、匯則興邦」的理念和「包容、合作、創新、拓展」的準則，其權威性得到各界肯定和認同。', '2021-08-07');
