INSERT INTO `navigation_msg` VALUES (3019, '海口网', '实时关注', 'http://hkwb.net', 'http://css.hkwb.net/images/favicon.ico', '海口网提供海口最权威,最快捷,最全面的海口新闻,是海口市唯一重点新闻网站,汇集海口新闻,生活资讯,汽车,体育,娱乐,视频,人文,健康,教育,旅游,,婚庆,美食等为一体的海口权威新闻门户网站，看新闻就上海口网。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3020, '新华网', '实时关注', 'http://xinhua.org', 'http://www.xinhuanet.com/favicon.ico', '中国主要重点新闻网站,依托新华社遍布全球的采编网络,记者遍布世界100多个国家和地区,地方频道分布全国31个省市自治区,每天24小时同时使用6种语言滚动发稿,权威、准确、及时播发国内外重要新闻和重大突发事件,受众覆盖200多个国家和地区,发展论坛是全球知名的中文论坛。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3021, '中国环境网', '实时关注', 'http://cenews.com.cn', NULL, '中国环境网：《中国环境报》官网、国内第一家环保专业网站《中国环境报》是全球唯一一张国家级的环境保护报纸，是生态环境部直属新闻单位。中国环境网依托优势资源，以环境领域报道的专业性、权威性、多样性、及时性为特色，打造成为当今最大、最具影响力的环境互联网平台。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3022, '中国网新闻中心', '实时关注', 'http://news.china.com.cn', NULL, '国家重点新闻网站，中国网新闻中心全面、深入报道中国，提供权威、原创的时政、社会、国际、军事新闻资讯，发出中国声音、表达中国立场。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3023, '知音网', '实时关注', 'http://zhiyin.cn', 'http://www.zhiyin.cn/favicon.ico', '知音网是中国第1情感门户网，知音传媒集团旗下女性网站。倡导人情美、人性美，报道情感新闻，讲述情感故事，频道内容涉及新闻、情感、两性、娱乐、名家专栏、健康、婚姻、情感信箱、知音故事、读图等与女性密切相关的各方面栏目。', '2021-08-07');
