INSERT INTO `navigation_msg` VALUES (3025, '消费日报网', '实时关注', 'http://xfrb.com.cn', NULL, '由消费日报社主办的《消费日报》是我国消费领域中一张全国性、全方位、大容量的综合性日报。其立足消费领域，依托轻工行业，面向城乡市场，最先发布相关的专业权威信息以及消费景气预报。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3026, '求是理论网', '实时关注', 'http://qstheory.cn', 'http://www.qstheory.cn/favicon.ico', '求是网是中国共产党中央委员会机关刊《求是》杂志主办的理论宣传研究平台。求是网的目标定位是突出理论特色，既体现权威性、理论性、指导性，又体现时效性、开放性、互动性，发挥权威理论网站的引导、整合、服务功能，努力建设成为广大干部群众和理论工作者的理论宣传平台、思想激荡平台、学习交流平台、文献检索平台。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3027, '梅花网', '实时关注', 'http://meihua.info', 'https://www.meihua.info/static/images/icon/meihua.ico', '梅花网聚焦行业营销案例,致力于成为国内收录数量和信息价值俱佳的营销作品宝库。作品涵盖平面海报、视频制作、创意设计、公关活动等,为行业上下游打造一个合作共赢的互动交流和在线对接平台。', '2021-08-07');
