INSERT INTO `navigation_msg` VALUES (3041, '中国宁波网', '实时关注', 'http://cnnb.com.cn', 'http://zt.cnnb.com.cn/new_small_template/image/nblogo.ico', '中国宁波网由中共宁波市委宣传部和宁波日报报业集团联合主办，创办于2001年6月1日，是宁波市唯一一家经国务院新闻办公室批准正式建立的综合性重点新闻网站。中国宁波网作为宁波市级主流媒体，立足宁波、辐射华东，为用户提供新闻、资讯、服务、论坛、游戏等多种网络产品，以及宁波日报报业集团旗下《宁波日报》《宁波晚报》《东南商报》等10家报刊电子版。', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3042, '桂林生活网', '实时关注', 'http://guilinlife.com', NULL, '桂林生活网（Guilinlife.com）由桂林日报社主办，定位于为桂林百姓生活服务，经过十年的不懈努力，桂林生活网已发展成为桂林的门户网站和城市名片，桂林生活网，做桂林人的网上家园！', '2021-08-07');
INSERT INTO `navigation_msg` VALUES (3043, '环球网', '实时关注', 'http://www.huanqiu.com', '//rs2.huanqiucdn.cn/huanqiu/image/www/common/favicon1.ico', '环球网是中国领先的国际资讯门户，拥有独立采编权的中央重点新闻网站。环球网秉承环球时报的国际视野，力求及时、客观、权威、独立地报道新闻，致力于应用前沿的互联网技术，为全球化时代的中国互联网用户提供与国际生活相关的资讯服务、互动社区。未来会致力于打造全球化在线生活平台，成为中国与国际之间沟通与交流的桥梁。', '2021-08-07');
